import mealsImage from '../../assets/meals.jpeg';
import classes from './Header.module.css';


const Header = (props) => {
<Fragment>
    <header className={classes.header}>
        <h1> React Meals </h1>
        <button> Cart </button>
    </header>
    <div>
    <img src={mealsImage} alt="meals"/>
    </div>
</Fragment>
}

export default Header;
